css:
.git-control .logger {
  width: 100%;
  height: 34%;
  overflow-y: scroll;
  border-top: 1px solid #201f1d;
  padding: 10px 10px 70px 10px;
  background: inherit;
}
.git-control .logger pre {
  color: rgba(173, 170, 164, 0.6);
  border: none;
}
.git-control .logger pre.error {
  color: #ff6347;
}
